DESCRIPTION
Featuring: Lily LaBeau &amp; Lily Carter!

There's absolutely nothing sweeter than beautiful girls locked in a deep kiss. Sweetheart brings you four passionate scenes for feminine love. Lily carter's mom hopes to surprise her daughter by inviting her old friend, Lily LaBeau, to stay with them. But can Lily Carter get over her memories of their girlhood experimentation? Sinn is intrigued by Charley's new sweetheart. When she finds out the sweetheart is a girl, Sinn's curiosity takes over. Bobbi's had enough of Shyla, hogging the bathroom, stealing her clothes, etc. After they have a catfight, they have some making up to do. Skin and Asa are stressed over exams and decide to take a break. Will they stop with one glass of red wine or just let themselves go? The 9th installment of Girls Kissing Girls is sure to top any list of lesbian erotica. Written and directed by Nica Noelle!
